import React from "react";
import AppBar from "@material-ui/core/AppBar";
import { makeStyles } from "@material-ui/core/styles";
import Toolbar from "@material-ui/core/Toolbar";
import HomeIcon from "../generalhome/HomeIcon";
import Link from "@material-ui/core/Link";
import "../../../../index.css";

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
    backgroundColor: "#d2dae3",
  },
}));

export default function UserNavBar1() {
  const classes = useStyles();
  return (
    <div className={classes.grow}>
      <AppBar position="static" style={{ backgroundColor: "#00b643" }}>
        <Toolbar>
          <Link
            href="/"
            style={{
              color: "inherit",
              fontFamily: "Lobster",
              fontSize: "1.2rem",
            }}
          >
            My-Portfolio
          </Link>
          <HomeIcon></HomeIcon>
          <Link
            href="/"
            style={{
              color: "inherit",
              fontSize: "1.2rem",
            }}
          >
            Create Protfolio
          </Link>
        </Toolbar>
      </AppBar>
    </div>
  );
}
